import React from "react";
import SocialMedia from "./SocialMedia";
import Particles, { ISourceOptions, Main } from "react-tsparticles";
import { loadSeaAnemonePreset } from "tsparticles-preset-sea-anemone";


function WelcomPage(){
    const options = {
        preset: "seaAnemone",
        particles: {
          move: {
            speed: 2
          }
        }
    };
    const initialize = (instance: Main) => {
      loadSeaAnemonePreset(instance);
    };
    tsParticles.load("tsparticles", {
      preset: "seaAnemone",
      particles: {
        move: {
          speed: 2
        }
      }
    });


    return(
        <section name="section1" className="welcom_page" id="tsparticule">
            <div className="pict_component">
            <div className="memoji"></div>
            <div className="principal_pict">
            <Particles options={options} init={initialize} />
            </div>
            <div className="socialmedia_component">
                <SocialMedia/>
            </div>
            </div>
        </section>
    )
}
export default WelcomPage;
